	$.fn.pagination = function(opt){
		opt = $.extend({show:2}, opt);
		
		return this.each(function(){
			var $this = $(this), $p = $(this).find('p').html('');
			if ( opt.total <= 1)
			{
				$this.find('a.prev').hide();
				$this.find('a.next').hide();
				return;
			}
			
			var start = opt.current - opt.show;
			var stop = opt.current + opt.show;
			if ( opt.total <= opt.show*2+1 ){
				start = 1;
				stop = opt.total;
			}
			else{
				if ( start < 1 ) { start = 1; stop = start + opt.show*2; }
				if ( stop > opt.total ) { stop = opt.total; start = stop - opt.show*2; }
			}

			for( var i = start; i <= stop; i++){
				var $a = $('<a href="#">'+i+'</a>');
				if ( i == opt.current ) $a.addClass('on');
				$p.append($a);

			}
			if ( start > 1 ) { if( start != 2) $p.prepend('...'); else $p.prepend(' '); $p.prepend('<a href="#">1</a>');}
			if ( stop < opt.total ){ if ( stop != opt.total - 1 ) $p.append('...'); else $p.append(' '); $p.append('<a href="#">'+opt.total+'</a>');}

			if ( opt.current == 1 ) $this.find('a.prev').hide(); else $this.find('a.prev').show();
			if ( opt.current == opt.total ) $this.find('a.next').hide(); else $this.find('a.next').show();
		});
	};
